import React from 'react';
import { Box, Grid, Typography, Container, Stack, Paper, Chip } from '@mui/material';
import { motion } from 'framer-motion';
import { Shield, Zap, Crown, TrendingUp, Users, Award } from 'lucide-react';
import EnhancedTierCard from './EnhancedTierCard.tsx';

const EnhancedTierGrid = ({ 
  tiers, 
  isInCart, 
  onAddToCart, 
  onRemoveFromCart,
  getTierColor,
  getTierIcon,
  getTierDescription,
  theme 
}) => {
  if (!tiers || tiers.length === 0) {
    return (
      <Box sx={{ textAlign: 'center', py: 6 }}>
        <Typography variant="h6" color="text.secondary">
          No tiers available for this sub-bundle.
        </Typography>
      </Box>
    );
  }

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.1,
        delayChildren: 0.2
      }
    }
  };

  const headerVariants = {
    hidden: { opacity: 0, y: -30 },
    visible: {
      opacity: 1,
      y: 0,
      transition: { duration: 0.6, ease: [0.25, 0.46, 0.45, 0.94] }
    }
  };

  return (
    <motion.div
      variants={containerVariants}
      initial="hidden"
      animate="visible"
    >
      <Container maxWidth="lg" sx={{ py: 4 }}>
        {/* Header Section */}
        <motion.div variants={headerVariants}>
          <Box sx={{ textAlign: 'center', mb: 6 }}>
            <Typography 
              variant="h3" 
              fontWeight="bold" 
              color="white" 
              sx={{ mb: 2 }}
            >
              Choose Your Plan
            </Typography>
            <Typography 
              variant="h6" 
              color="#aaa" 
              sx={{ mb: 4, maxWidth: 600, mx: 'auto' }}
            >
              Select the perfect security tier for your needs. All plans include 24/7 support and a 30-day money-back guarantee.
            </Typography>

            {/* Feature Highlights */}
            <Stack 
              direction={{ xs: 'column', sm: 'row' }} 
              spacing={2} 
              justifyContent="center"
              sx={{ mb: 4 }}
            >
              <Paper
                sx={{
                  px: 3,
                  py: 1.5,
                  bgcolor: 'rgba(76, 175, 80, 0.1)',
                  border: '1px solid rgba(76, 175, 80, 0.3)',
                  borderRadius: 3
                }}
              >
                <Stack direction="row" spacing={1} alignItems="center">
                  <Shield size={18} color="#4caf50" />
                  <Typography variant="body2" color="#4caf50" fontWeight="medium">
                    Enterprise Security
                  </Typography>
                </Stack>
              </Paper>

              <Paper
                sx={{
                  px: 3,
                  py: 1.5,
                  bgcolor: 'rgba(33, 150, 243, 0.1)',
                  border: '1px solid rgba(33, 150, 243, 0.3)',
                  borderRadius: 3
                }}
              >
                <Stack direction="row" spacing={1} alignItems="center">
                  <TrendingUp size={18} color="#2196f3" />
                  <Typography variant="body2" color="#2196f3" fontWeight="medium">
                    AI-Powered Analytics
                  </Typography>
                </Stack>
              </Paper>

              <Paper
                sx={{
                  px: 3,
                  py: 1.5,
                  bgcolor: 'rgba(156, 39, 176, 0.1)',
                  border: '1px solid rgba(156, 39, 176, 0.3)',
                  borderRadius: 3
                }}
              >
                <Stack direction="row" spacing={1} alignItems="center">
                  <Users size={18} color="#9c27b0" />
                  <Typography variant="body2" color="#9c27b0" fontWeight="medium">
                    24/7 Support
                  </Typography>
                </Stack>
              </Paper>
            </Stack>
          </Box>
        </motion.div>

        {/* Tier Cards Grid */}
        <Grid container spacing={4} justifyContent="center">
          {tiers.map((tier, index) => (
            <Grid item xs={12} sm={6} lg={4} key={tier.id}>
              <EnhancedTierCard
                tier={tier}
                index={index}
                isInCart={isInCart(tier.id)}
                onAddToCart={onAddToCart}
                onRemoveFromCart={onRemoveFromCart}
                getTierColor={getTierColor}
                getTierIcon={getTierIcon}
                getTierDescription={getTierDescription}
                theme={theme}
              />
            </Grid>
          ))}
        </Grid>

        {/* Bottom CTA Section */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: 1, duration: 0.6 }}
        >
          <Box sx={{ textAlign: 'center', mt: 8, mb: 4 }}>
            <Paper
              sx={{
                p: 4,
                bgcolor: 'rgba(255, 255, 255, 0.02)',
                border: '1px solid rgba(255, 255, 255, 0.1)',
                borderRadius: 4,
                backdropFilter: 'blur(10px)'
              }}
            >
              <Stack direction="row" spacing={2} justifyContent="center" alignItems="center" sx={{ mb: 3 }}>
                <Award size={24} color="#ffc107" />
                <Typography variant="h5" fontWeight="bold" color="white">
                  Trusted by 10,000+ Organizations
                </Typography>
              </Stack>

              <Typography variant="body1" color="#aaa" sx={{ mb: 3, maxWidth: 600, mx: 'auto' }}>
                Join thousands of satisfied customers who trust our security solutions to protect their most valuable assets.
              </Typography>

              <Stack 
                direction={{ xs: 'column', sm: 'row' }} 
                spacing={3} 
                justifyContent="center"
                alignItems="center"
              >
                <Box sx={{ textAlign: 'center' }}>
                  <Typography variant="h4" fontWeight="bold" color="#4caf50">
                    99.9%
                  </Typography>
                  <Typography variant="body2" color="#aaa">
                    Uptime
                  </Typography>
                </Box>

                <Box sx={{ textAlign: 'center' }}>
                  <Typography variant="h4" fontWeight="bold" color="#2196f3">
                    24/7
                  </Typography>
                  <Typography variant="body2" color="#aaa">
                    Support
                  </Typography>
                </Box>

                <Box sx={{ textAlign: 'center' }}>
                  <Typography variant="h4" fontWeight="bold" color="#9c27b0">
                    30-Day
                  </Typography>
                  <Typography variant="body2" color="#aaa">
                    Guarantee
                  </Typography>
                </Box>
              </Stack>
            </Paper>
          </Box>
        </motion.div>
      </Container>
    </motion.div>
  );
};

export default EnhancedTierGrid;
